    private void hitungActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_hitungActionPerformed
        // TODO add your handling code here:
        int j1,j2,j3,j4,j5,j6,j7,j8,j9,j10,j11,j12,j13,j14,j15
        ,b1,b2,b3,b4,b5,b6,b7,b8,b9,b10,b11,b12,b13,b14;
        try{
            j1=Integer.parseInt(this.j1.getText());
            j2=Integer.parseInt(this.j2.getText());
            j3=Integer.parseInt(this.j3.getText());
            j4=Integer.parseInt(this.j4.getText());
            j5=Integer.parseInt(this.j5.getText());
            j6=Integer.parseInt(this.j6.getText());
            j7=Integer.parseInt(this.j7.getText());
            j8=Integer.parseInt(this.j8.getText());
            j9=Integer.parseInt(this.j9.getText());
            j10=Integer.parseInt(this.j10.getText());
            j11=Integer.parseInt(this.j11.getText());
            j12=Integer.parseInt(this.j12.getText());
            j13=Integer.parseInt(this.j13.getText());
            j14=Integer.parseInt(this.j14.getText());
            j15=Integer.parseInt(this.j15.getText());
            b1=Integer.parseInt(this.b1.getText());
            b2=Integer.parseInt(this.b2.getText());
            b3=Integer.parseInt(this.b3.getText());
            b4=Integer.parseInt(this.b4.getText());
            b5=Integer.parseInt(this.b5.getText());
            b6=Integer.parseInt(this.b6.getText());
            b7=Integer.parseInt(this.b7.getText());
            b8=Integer.parseInt(this.b8.getText());
            b9=Integer.parseInt(this.b9.getText());
            b10=Integer.parseInt(this.b10.getText());
            b11=Integer.parseInt(this.b11.getText());
            b12=Integer.parseInt(this.b12.getText());
            b13=Integer.parseInt(this.b13.getText());
            b14=Integer.parseInt(this.b14.getText());
        }
        catch(Exception e){
            JOptionPane.showMessageDialog(this, "Isikan Form Dengan Angka Yang Valid","Error", JOptionPane.ERROR_MESSAGE);
            return;
        }

        int p1=j1*3,p2=j2*4,p3=j3*3,p4=j4*7,p5=j5*6
        ,p6=j6*4,p7=j7*5,p8=j8*4,p9=j9*10,p10=j10*7
        ,p11=j11*6,p12=j12*7,p13=j13*6,p14=j14*15,p15=j15*10;
        this.p1.setText(String.valueOf(p1));
        this.p2.setText(String.valueOf(p2));
        this.p3.setText(String.valueOf(p3));
        this.p4.setText(String.valueOf(p4));
        this.p5.setText(String.valueOf(p5));
        this.p6.setText(String.valueOf(p6));
        this.p7.setText(String.valueOf(p7));
        this.p8.setText(String.valueOf(p8));
        this.p9.setText(String.valueOf(p9));
        this.p10.setText(String.valueOf(p10));
        this.p11.setText(String.valueOf(p11));
        this.p12.setText(String.valueOf(p12));
        this.p13.setText(String.valueOf(p13));
        this.p14.setText(String.valueOf(p14));
        this.p15.setText(String.valueOf(p15));

        int cfp1=p1+p6+p11,cfp2=p2+p7+p12,cfp3=p3+p8+p13,cfp4=p4+p9+p14,cfp5=p5+p10+p15;
        this.cfp1.setText(String.valueOf(cfp1));
        this.cfp2.setText(String.valueOf(cfp2));
        this.cfp3.setText(String.valueOf(cfp3));
        this.cfp4.setText(String.valueOf(cfp4));
        this.cfp5.setText(String.valueOf(cfp5));

        int cfptotal=cfp1+cfp2+cfp3+cfp4+cfp5;
        this.cfptotal.setText(String.valueOf(cfptotal));

        int rcaf=b1+b2+b3+b4+b5+b6+b7+b8+b9+b10+b11+b12+b13+b14;
        this.rcaf.setText(String.valueOf(rcaf));

        this.rumus.setText("FP = "+cfptotal+" x (0.65 + 0.01 x "+rcaf+")");

        double fp=cfptotal*(0.65+0.01*rcaf);
        this.hasil.setText("FP = "+fp);
    }//GEN-LAST:event_hitungActionPerformed

